query users($orderBy: OrderByUserInput, $filter: FilterUserInput) {
  users(orderBy: $orderBy, filter: $filter) {
    ...UserInfo
    __typename
  }
}

fragment UserInfo on User {
  id
  username
  role
  isActive
  email
  profile {
    ...UserProfileInfo
    __typename
  }
  auth {
    certificate {
      serial
      __typename
    }
    __typename
  }
  __typename
}

fragment UserProfileInfo on UserProfile {
  firstName
  lastName
  fullName
  __typename
}
